//[奇遇]35[渡天劫]buff配置package cn.mxz;public class CopterBuffTemplet {	/** 	 * buffid 	 */	private int id;	/** 	 * 前端显示buff类型（0气血 1攻击 3防御 5 速度） 	 */	private int previous;	/** 	 * 后端实际增加的属性类型（0气血 1物攻 2法攻 3物防 4法防 5速度） 	 */	private String front;	/** 	 * 属性数值（百分比） 	 */	private float frontPar;	/** 	 * 属性档次 	 */	private int grade;	/** 	 * 消耗星星数 	 */	private int star;	/**	 * buffid	 */	void setId(int id) {		this.id = id;	}	/**	 * buffid	 */	public int getId() {		return this.id;	}	/**	 * 前端显示buff类型（0气血 1攻击 3防御 5 速度）	 */	void setPrevious(int previous) {		this.previous = previous;	}	/**	 * 前端显示buff类型（0气血 1攻击 3防御 5 速度）	 */	public int getPrevious() {		return this.previous;	}	/**	 * 后端实际增加的属性类型（0气血 1物攻 2法攻 3物防 4法防 5速度）	 */	void setFront(String front) {		this.front = front;	}	/**	 * 后端实际增加的属性类型（0气血 1物攻 2法攻 3物防 4法防 5速度）	 */	public String getFront() {		return this.front;	}	/**	 * 属性数值（百分比）	 */	void setFrontPar(float frontPar) {		this.frontPar = frontPar;	}	/**	 * 属性数值（百分比）	 */	public float getFrontPar() {		return this.frontPar;	}	/**	 * 属性档次	 */	void setGrade(int grade) {		this.grade = grade;	}	/**	 * 属性档次	 */	public int getGrade() {		return this.grade;	}	/**	 * 消耗星星数	 */	void setStar(int star) {		this.star = star;	}	/**	 * 消耗星星数	 */	public int getStar() {		return this.star;	}}